import React from "react";
 function add(x,y){
     return x+y;


 }
 function sub(x,y){
     return x-y;

 }
 function multiply(x,y){
     return x*y;
 }
 function division(x,y){
     let division=x/y;
     let final=division.toFixed(2);
     return final;
 }
 export default add;
 export {sub,multiply,division};
